                <img className={classes.product_img} src="#" alt="product image" />
                <h3 className={classes.product_title}>
                    {/* {product.title} */}
                    title
                </h3>
                <p className={classes.product_description}>
                    {/* {product.description} */}
                    description
                </p>
            </div>
            <div className={classes.product_culc}>

            </div>
        </div>
    )
}

